import { Router, Routes, Route, Link } from 'react-router-dom';
import home_icon from '../icons/home_icon.png';

export const Navbar = () => {
    return (
        <div>
            <h2> SCHEDULER </h2>
            <br></br>
            <img src={home_icon} alt="home icon" width="10" height="10"/>
            <Link to={"/"}> Home </Link>
            <br></br>
            <Link to={"/Completed"}> Completed </Link>
            <br></br>
            <Link to={"/Work"}> Work </Link>
        </div>
    );
}
